import React from "react";
import '../assets/css/matchHeader.css';
//import axios from 'axios';

const MatchHeader = props =>(
      <div className="card">
            <div className="contents"><h5>Match-1</h5></div>
            <div className="contents"><h5>Match-2</h5></div>
            <div className="contents"><h5>Match-3</h5></div>
            <div className="contents"><h5>Match-4</h5></div>
            <div className="contents"><h5>Match-5</h5></div>
            <div className="contents"><h5>Match-6</h5></div>
            <div className="contents"><h5>Match-7</h5></div>
            <div className="contents"><h5>Match-8</h5></div>
            <div className="contents"><h5>Match-9</h5></div>
      </div>
);

export default MatchHeader;
